import React from 'react';
import waterLeaf from './components/images/waterLeaf.jpeg';
import './App.css';
import { Route } from 'react-router-dom'
import  Home from './components/Home'
import About from './components/About'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          Our App
        </h1>
        <Route exact path="/" component={Home}/>
        <Route render={<About/>}exact path="About" component={About}/>
        <img alt="water leaf"src={waterLeaf}>
        </img>
      </header>
    </div>
  );
}

export default App;
